			$dataAdapter = New-Object MySql.Data.MySqlClient.MySqlDataAdapter($command)
			
			$dataSet = New-Object System.Data.DataSet
			$recordCount = $dataAdapter.Fill($dataSet)
			$connection.Close()
		}
		Catch
