			[System.Windows.Forms.MessageBox]::Show("Pri práci s databázou sa vyskytla kritická chyba. Zobrazované dáta môžu byť nekompletné. `n $logException ")
			$connection.Close()		
		}
		
		return $dataSet
	}
	
