	#endregion Generated Form Objects

	#----------------------------------------------
	# User Generated Script
	#----------------------------------------------
	#Loads Form
	$formPridanieNovejLokalit_Load={
	
		[directoryservices.directoryEntry]$root = (new-object system.directoryservices.directoryEntry)
		$root.distinguishedName = "DC=ucn,DC=muni,DC=cz"
		$root.name = "ucn.muni.cz"
		[Switch]$LoadOnly
		Browse-ActiveDirectory $root
		
	}
	
	#Loads active directory tree
	Function Browse-ActiveDirectory
	{
		param ([directoryservices.directoryEntry]$root = (new-object system.directoryservices.directoryEntry))
		
		# Try to connect to the Domain root
		
		&{ trap { throw "$($_)" }; [void]$Root.get_Name() }
		
		#Clear tree
		
		$TV.Nodes.Clear()
		
		# Create a TreeNode for the domain root found
		
		$TNRoot = new-object System.Windows.Forms.TreeNode("Root")
		$TNRoot.Name = $root.distinguishedName
		$TNRoot.Text = $root.name
		$TNRoot.tag = "NotEnumerated"
		
		# First time a Node is Selected, enumerate the Children of the selected DirectoryEntry
		
		$TV.add_AfterSelect({
			
			$textbox1.Text= $($this.SelectedNode.Name)
			
			if ($this.SelectedNode.tag -eq "NotEnumerated")
			{
				
				$de = new-object system.directoryservices.directoryEntry("LDAP://$($this.SelectedNode.Name)")
				
				# Add all Children found as Sub Nodes to the selected TreeNode
				$deChildren = $de.get_Children()
				$deChildren | foreach {
					$TN = new-object System.Windows.Forms.TreeNode
					$TN.Name = $_.distinguishedName
					$TN.Text = $_.name
					$TN.tag = "NotEnumerated"
					$this.SelectedNode.Nodes.Add($TN)
				}
				
				# Set tag to show this node is already enumerated
				
				$this.SelectedNode.tag = "Enumerated"
			}
		})
		
		# Add the RootNode to the Treeview
		
		[void]$TV.Nodes.Add($TNRoot)	
		
		# Return selected DirectoryEntry or $false as Cancel Button is Used
		Return $script:Return
	}
	
	$combobox1_SelectedIndexChanged={
	
		[directoryservices.directoryEntry]$root = (new-object system.directoryservices.directoryEntry)
	
		switch ($combobox1.SelectedItem.ToString()) {
			"ucn.muni.cz" {
				$root.distinguishedName = "DC=ucn,DC=muni,DC=cz"
				$root.name = "ucn.muni.cz"
			}
			"ups.ucn.muni.cz" {
				$root.distinguishedName = "DC=ups,DC=ucn,DC=muni,DC=cz"
				$root.name = "ups.ucn.muni.cz"
			}
			"staff.ucn.muni.cz" {
				$root.distinguishedName = "DC=staff,DC=ucn,DC=muni,DC=cz"
				$root.name = "staff.ucn.muni.cz"
			}
			default {
				$root.distinguishedName = "DC=ucn,DC=muni,DC=cz"
				$root.name = "ucn.muni.cz"
			}
		}
		Browse-ActiveDirectory $root
	}
	
	$buttonPridat_Click={
		
		$nameLokalita = $textbox2.Text
		$dn = $textbox1.Text
		if (($nameLokalita -notlike "") -and ($dn -notlike "") -and ($textbox3.Text -ne ""))
		{
			$fronta = New-Object System.Data.DataSet
			$fronta = MysqlQuerySelect -query "SELECT * FROM lokality WHERE name='$nameLokalita' OR dn='$dn'"
			if ($fronta.Tables[0].rows.count -eq 0)
			{
				$broadcast = $textbox3.Text
				$checkFunkcia = $false
				
				if ($checkboxBudeniePC.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'budenie', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkboxVypínaniePC.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'vypinanie', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkboxReštartPC.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'restart', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkboxRežimPC.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'rezim', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkboxScheduler.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'scheduler', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkboxAccess.Checked)
				{
					MysqlQueryInsert -query "INSERT INTO lokality (id, name, dn, funkcia, broadcast) VALUES('','$nameLokalita', '$dn', 'pristupy', '$broadcast')"
					$checkFunkcia = $true
				}
				if ($checkFunkcia)
				{
					$formPridanieNovejLokalit.Close()
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
				}
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show("Lokalita s rovnakým názvom alebo DN už existuje")
			}
		}
		else
		{
			[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
		}
	}
