	#Loads form
	$formPridanieNovehoUzivat_Load={
		loadDataToLokalityCombobox
	}
	
	#Loads localities data to combobox
	function loadDataToLokalityCombobox()
	{
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality GROUP BY name ORDER BY name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$dataTable | ForEach-Object{
			[string]$item = $_.name
			$combobox1.Items.Add($item)
		}
	}
	
	$buttonPridat_Click={
		
		$nameLokalita = $combobox1.SelectedItem.ToString()
		$name = $textbox1.Text
		$userExist=$false
		if (get-aduser -identity $name)
		{
			$userExist = $true
		}
		else
		{
			$userExist = $false
		}
		if (get-adgroup -identity $name)
		{
			$userExist = $true
		}
		else
		{
			$userExist = $false
		}
		
		if ($userExist -eq $true)
		{
			if (($nameLokalita -notlike "") -and ($name -notlike ""))
			{
				$fronta = New-Object System.Data.DataSet
				$fronta = MysqlQuerySelect -query "SELECT * FROM acl WHERE name='$name' AND id_lokalita='$id_lokalita'"
				if ($fronta.Tables[0].rows.count -eq 0)
				{
					$checkFunkcia = $false
					$id_lokalita = $nameLokalita
					if ($checkboxBudeniePC.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'budenie')"
						$checkFunkcia = $true
					}
					if ($checkboxVypínaniePC.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'vypinanie')"
						$checkFunkcia = $true
					}
					if ($checkboxReštartPC.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'restart')"
						$checkFunkcia = $true
					}
					if ($checkboxRežimPC.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'rezim')"
						$checkFunkcia = $true
					}
					if ($checkboxScheduler.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'scheduler')"
						$checkFunkcia = $true
					}
					if ($checkboxPristupy.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'pristupy')"
						$checkFunkcia = $true
					}
					if ($checkboxOSS.Checked)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'oss')"
						$checkFunkcia = $true
					}
					if ($checkFunkcia)
					{
						MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'log')"
						$formPridanieNovehoUzivat.Close()
					}
					else
					{
						[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
					}
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Užívateľ alebo skupina už existujú")
				}
				
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
			}
		}
		else
		{
			[System.Windows.Forms.MessageBox]::Show("Meno alebo skupina neexistuje")
		}
	}
	
	$combobox1_SelectedIndexChanged={
	
		$name = $combobox1.SelectedItem.ToString()
		
		$checkboxBudeniePC.Enabled = $false
		
		$checkboxVypínaniePC.Enabled = $false
		
		$checkboxReštartPC.Enabled = $false
		
		$checkboxRežimPC.Enabled = $false
		
		$checkboxScheduler.Enabled = $false
		
		$checkboxOSS.Enabled = $false
		
		$checkboxPristupy.Enabled = $false
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE name='$name' GROUP BY funkcia"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
	
		$dataTable | ForEach-Object{
			switch ($_.funkcia) {
				"budenie" {
					$checkboxBudeniePC.Enabled = $true
				}
