	#----------------------------------------------
	[System.Windows.Forms.Application]::EnableVisualStyles()
	$formRestartPC = New-Object 'System.Windows.Forms.Form'
	$groupbox3 = New-Object 'System.Windows.Forms.GroupBox'
	$buttonRestartovatVsetkyPC = New-Object 'System.Windows.Forms.Button'
	$buttonRestartovatVybranePC = New-Object 'System.Windows.Forms.Button'
	$groupbox2 = New-Object 'System.Windows.Forms.GroupBox'
	$listbox1 = New-Object 'System.Windows.Forms.ListBox'
	$groupbox1 = New-Object 'System.Windows.Forms.GroupBox'
	$combobox1 = New-Object 'System.Windows.Forms.ComboBox'
	$InitialFormWindowState = New-Object 'System.Windows.Forms.FormWindowState'
	#endregion Generated Form Objects

	#----------------------------------------------
	# User Generated Script
	#----------------------------------------------
	#Load form
	$formRestartPC_Load={
		loadDataToLokalityCombobox
	}
	
	#Load locality where permission is allow
	function loadDataToLokalityCombobox()
	{
		$source = @()
		$groups = "acl.name='" + $author + "' "
		Get-ADPrincipalGroupMembership -Identity $author -server $domainControler | ForEach-Object{
			$groups += "OR acl.name='" + $_.name + "' "
		}
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality INNER JOIN acl ON lokality.name=acl.id_lokalita WHERE ($groups) AND acl.funkcia='restart' AND lokality.funkcia='restart' GROUP BY lokality.name ORDER BY lokality.name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		
		$dataTable | foreach {
			$tmp = [pscustomobject]@{
				id = $_.id
				name = $_.name
			}
			$source += $tmp
		}
		
		Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
		
	}
	
	#Load PCs from AD locality via LDAP to listbox
	function loadList()
	{
		param (
			[Parameter(Mandatory = $True, Position = 1)]
			[string]$dn
		)
		$listbox1.Items.Clear()
		$listbox1.Sorted = $true
		$domenaRaw = $dn -split "DC="
		$domenaRaw[1] = $domenaRaw[1] -replace ".$"
		$domenaRaw[2] = $domenaRaw[2] -replace ".$"
		$domenaRaw[3] = $domenaRaw[3] -replace ".$"
		$domena = $domenaRaw[1] + "." + $domenaRaw[2] + "." + $domenaRaw[3] + "." + $domenaRaw[4]
		
		$ldapSettings = "LDAP://$dn"
		$root = [ADSI]$ldapSettings
		$search = [adsisearcher]$root
		$Search.Filter = "(&(objectCategory=computer))"
		$colResults = $Search.FindAll()
		foreach ($i in $colResults)
		{
			$item = "" + $i.Properties.Item('cn') + "." + $domena + ""
			[void] $listbox1.Items.Add($item)
		}
	}
	
	$combobox1_SelectedIndexChanged={
	
		$dataCombo = $combobox1.SelectedItem.ToString()
		$id = $combobox1.SelectedItem.id
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality WHERE id='$id' LIMIT 1"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		loadList -dn $dataTable[0].dn
	}
	
	$buttonRestartovatVybranePC_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete reštartovať vybrané PC?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			if ($listbox1.SelectedItems.Count -eq 0)
			{
				[System.Windows.Forms.MessageBox]::Show("Neboli vybrané žiadne PC")
			}
			else
			{
				#$lokalitaData = $combobox1.SelectedItem.ToString().Split('-')
				$zoznam = $combobox1.SelectedItem.id.ToString() + ";"
				$pc = $listbox1.SelectedItems
				$pc | foreach{
					$zoznam += $_.ToString() + ','
				}
				$zoznam = $zoznam -replace ".$"
				$date = Get-Date -Format u
				MysqlQueryInsert -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'restart', '$zoznam', 'WAITING', '$date', '$author')"
				[System.Windows.Forms.MessageBox]::Show("Akcia bola pridaná do fronty. Aktuálny stav môžete sledovať v aplikácii Logy")
				$formRestartPC.Close()
			}
		}
	}
	
	$buttonRestartovatVsetkyPC_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete reštartovať vybrané PC?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			if ($listbox1.Items.Count -eq 0)
			{
				[System.Windows.Forms.MessageBox]::Show("Nebola vybraná lokalita")
			}
			else
			{
				#$lokalitaData = $combobox1.SelectedItem.ToString().Split('-')
