				$pc = $listbox1.SelectedItems
				$listbox1.Items | foreach{
					$zoznam += $_.ToString() + ','
				}
				$zoznam = $zoznam -replace ".$"
				$date = Get-Date -Format u
				MysqlQueryInsert -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'restart', '$zoznam', 'WAITING', '$date', '$author')"
