	#----------------------------------------------
	#load form
	$formRezimPC_Load={
		loadDataToLokalityCombobox
	}
	
	#Load locality where permission is allow
	function loadDataToLokalityCombobox()
	{
		$source = @()
		$groups = "acl.name='" + $author + "' "
		Get-ADPrincipalGroupMembership -Identity $author -server $domainControler | ForEach-Object{
			$groups += "OR acl.name='" + $_.name + "' "
		}
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM lokality INNER JOIN acl ON lokality.name=acl.id_lokalita WHERE ($groups) AND acl.funkcia='rezim' AND lokality.funkcia='rezim' GROUP BY lokality.name ORDER BY lokality.name ASC"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		
		$dataTable | foreach {
			$tmp = [pscustomobject]@{
				id = $_.id
				name = $_.name
			}
			$source += $tmp
		}
		
		Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
		
	}
	
	#load PCs to listbox from AD via LDAP
	function loadList()
	{
		param (
			[Parameter(Mandatory = $True, Position = 1)]
			[string]$dn
		)
		
		$domenaRaw = $dn -split "DC="
		$domenaRaw[1] = $domenaRaw[1] -replace ".$"
		$domenaRaw[2] = $domenaRaw[2] -replace ".$"
		$domenaRaw[3] = $domenaRaw[3] -replace ".$"
		$domena = $domenaRaw[1] + "." + $domenaRaw[2] + "." + $domenaRaw[3] + "." + $domenaRaw[4]
		
		$ldapSettings = "LDAP://$dn"
		$root = [ADSI]$ldapSettings
		$search = [adsisearcher]$root
		$Search.Filter = "(&(objectCategory=computer))"
		$colResults = $Search.FindAll()
		foreach ($i in $colResults)
		{
			$item = "" + $i.Properties.Item('cn') + "." + $domena + ""
			[void] $listbox1.Items.Add($item)
		}
	}
	
	$buttonZmenitRezim_Click = {
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete zmeniť režim na vybraných PC?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			if ($combobox1.SelectedItem -eq $null -or $combobox2.SelectedItem -eq $null)
			{
				[System.Windows.Forms.MessageBox]::Show("Výber lokality a režimu je povinný")
			}
			else
			{
				$rezim = $combobox2.SelectedItem.ToString()
				#$lokalitaData = $combobox1.SelectedItem.ToString().Split('-')
				$lokalita = $combobox1.SelectedItem.id.toString()
				$zoznam = $rezim + ";" + $lokalita
				$date = Get-Date -Format u
				MysqlQueryInsert -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'rezim', '$zoznam', 'WAITING', '$date', '$author')"
				[System.Windows.Forms.MessageBox]::Show("Akcia bola pridaná do fronty. Aktuálny stav môžete sledovať v aplikácii Logy")
				$formRezimPC.Close()
			}
		}
	}
	
	
	#region Control Helper Functions
	function Load-ComboBox 
	{
	<#
		.SYNOPSIS
			This functions helps you load items into a ComboBox.
	
		.DESCRIPTION
			Use this function to dynamically load items into the ComboBox control.
	
		.PARAMETER  ComboBox
			The ComboBox control you want to add items to.
	
		.PARAMETER  Items
			The object or objects you wish to load into the ComboBox's Items collection.
	
		.PARAMETER  DisplayMember
			Indicates the property to display for the items in this control.
		
		.PARAMETER  Append
			Adds the item(s) to the ComboBox without clearing the Items collection.
		
		.EXAMPLE
			Load-ComboBox $combobox1 "Red", "White", "Blue"
		
		.EXAMPLE
			Load-ComboBox $combobox1 "Red" -Append
			Load-ComboBox $combobox1 "White" -Append
			Load-ComboBox $combobox1 "Blue" -Append
		
		.EXAMPLE
			Load-ComboBox $combobox1 (Get-Process) "ProcessName"
	#>
		Param (
			[ValidateNotNull()]
			[Parameter(Mandatory=$true)]
			[System.Windows.Forms.ComboBox]$ComboBox,
			[ValidateNotNull()]
			[Parameter(Mandatory=$true)]
			$Items,
		    [Parameter(Mandatory=$false)]
			[string]$DisplayMember,
			[switch]$Append
		)
		
		if(-not $Append)
		{
			$ComboBox.Items.Clear()	
		}
		
		if($Items -is [Object[]])
		{
			$ComboBox.Items.AddRange($Items)
		}
		elseif ($Items -is [Array])
		{
			$ComboBox.BeginUpdate()
			foreach($obj in $Items)
			{
				$ComboBox.Items.Add($obj)	
			}
			$ComboBox.EndUpdate()
		}
		else
		{
			$ComboBox.Items.Add($Items)	
		}
	
		$ComboBox.DisplayMember = $DisplayMember	
	}
