	#Loads scheduler data to datagrid
	function loadDataToSchedulerOnceGrid()
	{
		$data = New-Object System.Data.DataSet
		$sqlSearch = $global:search2
		if ((checkAdminPermission -name $author) -eq $false)
		{
			$data = MysqlQuerySelect -query "SELECT scheduler.id, scheduler.disabled, scheduler.funkcia, scheduler.note, scheduler.name, scheduler.time, lokality.name AS lokalita, scheduler.author, scheduler.emailConfirm FROM scheduler INNER JOIN lokality ON scheduler.id_lokalita=lokality.id WHERE scheduler.typ='once' AND scheduler.author='$author' AND (scheduler.name LIKE '%$sqlSearch%' OR scheduler.funkcia LIKE '%$sqlSearch%' OR scheduler.note LIKE '%$sqlSearch%' OR scheduler.author LIKE '%$sqlSearch%' OR lokality.name LIKE '%$sqlSearch%' OR scheduler.emailConfirm LIKE '%$sqlSearch%')"
		}
		else
		{
			$data = MysqlQuerySelect -query "SELECT scheduler.id, scheduler.disabled, scheduler.funkcia, scheduler.note, scheduler.name, scheduler.time, lokality.name AS lokalita, scheduler.author, scheduler.emailConfirm FROM scheduler INNER JOIN lokality ON scheduler.id_lokalita=lokality.id WHERE scheduler.typ='once' AND (scheduler.name LIKE '%$sqlSearch%' OR scheduler.funkcia LIKE '%$sqlSearch%' OR scheduler.note LIKE '%$sqlSearch%' OR scheduler.author LIKE '%$sqlSearch%' OR lokality.name LIKE '%$sqlSearch%' OR scheduler.emailConfirm LIKE '%$sqlSearch%')"
		}
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$datagridview2.DataSource = $dataTable
	
	}
	
	#Loads data to scheduler repeat task datagrid
	function loadDataToSchedulerRepeatGrid()
	{
		$data = New-Object System.Data.DataSet
		$sqlSearch = $global:search1
		if ((checkAdminPermission -name $author) -eq $false)
		{
			$data = MysqlQuerySelect -query "SELECT scheduler.id, scheduler.disabled, scheduler.name, scheduler.funkcia, scheduler.note, scheduler.author, lokality.name AS lokalita, scheduler_time.time, scheduler_time.pondelok,scheduler_time.utorok, scheduler_time.streda, scheduler_time.stvrtok, scheduler_time.piatok, scheduler_time.sobota, scheduler_time.nedela, scheduler.emailConfirm FROM (scheduler INNER JOIN lokality ON scheduler.id_lokalita=lokality.id) INNER JOIN scheduler_time ON scheduler.id=scheduler_time.id_scheduler WHERE scheduler.typ='repeat' AND scheduler.author='$author' AND (scheduler.name LIKE '%$sqlSearch%' OR scheduler.funkcia LIKE '%$sqlSearch%' OR scheduler.note LIKE '%$sqlSearch%' OR scheduler.author LIKE '%$sqlSearch%' OR lokality.name LIKE '%$sqlSearch%' OR scheduler.emailConfirm LIKE '%$sqlSearch%')"
		}
		else
		{
			$data = MysqlQuerySelect -query "SELECT scheduler.id, scheduler.disabled, scheduler.name, scheduler.funkcia, scheduler.note, scheduler.author, lokality.name AS lokalita, scheduler_time.time, scheduler_time.pondelok,scheduler_time.utorok, scheduler_time.streda, scheduler_time.stvrtok, scheduler_time.piatok, scheduler_time.sobota, scheduler_time.nedela, scheduler.emailConfirm  FROM (scheduler INNER JOIN lokality ON scheduler.id_lokalita=lokality.id) INNER JOIN scheduler_time ON scheduler.id=scheduler_time.id_scheduler WHERE scheduler.typ='repeat' AND (scheduler.name LIKE '%$sqlSearch%' OR scheduler.funkcia LIKE '%$sqlSearch%' OR scheduler.note LIKE '%$sqlSearch%' OR scheduler.author LIKE '%$sqlSearch%' OR lokality.name LIKE '%$sqlSearch%' OR scheduler.emailConfirm LIKE '%$sqlSearch%')"
		}
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		$datagridview1.DataSource = $dataTable
	
	}
	
	
	$buttonOdstranitUlohuy_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete odstrániť vybranú(é) úlohu(y)?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$datagridview1.SelectedRows | foreach {
				$id = $_.cells[0].Value
				MysqlQueryInsert -query "DELETE FROM scheduler WHERE id='$id' LIMIT 1;DELETE FROM scheduler_time WHERE id_scheduler='$id' LIMIT 1"
			}
			loadDataToSchedulerRepeatGrid
		}
	}
	
