	#Changes color of row by value of property disabled
	function dataGridPaint1()
	{
		foreach ($row in $datagridview1.Rows)
		{
			if ($row.Cells[1].Value.ToString() -eq "Ano")
			{
				$row.DefaultCellStyle.BackColor = 'MistyRose'
			}
		}
	}
	
	function dataGridPaint2()
	{
		foreach ($row in $datagridview2.Rows)
		{
			if ($row.Cells[1].Value.ToString() -eq "Ano")
			{
				$row.DefaultCellStyle.BackColor = 'MistyRose'
			}
		}
	}
	
	
