						$vyber = $true
					}
					if ($checkboxSobota.Checked)
					{
						$so = "Áno"
						$vyber = $true
					}
					if ($checkboxNedeľa.Checked)
					{
						$ne = "Áno"
						$vyber = $true
					}
					if ($vyber)
					{
						$data = New-Object System.Data.DataSet
						$data = MysqlQuerySelect -query "INSERT INTO scheduler (id, id_lokalita, name, typ, time, funkcia, author, note, disabled, emailConfirm) VALUES('', '$id_lokalita', '$name', 'repeat', '$time', '$type', '$author', '$note', '$disabledFunction', '$emailConfirmText');SELECT LAST_INSERT_ID() AS id;"
						$dataTable = new-object System.Data.DataTable
						$dataTable = $data.Tables[0]
						
						$id_scheduler = $dataTable[0].id
						MysqlQueryInsert -query "INSERT INTO scheduler_time (id,time,pondelok,utorok,streda,stvrtok,piatok,sobota,nedela,id_scheduler) VALUES('', '$time', '$po', '$ut', '$str', '$stv', '$pia', '$so', '$ne', '$id_scheduler')"
						$formPridatOpakovanuUlohu.Close()
					}
					else
					{
						[System.Windows.Forms.MessageBox]::Show("Nebol vybraný žiadny deň v týdždni")
					}
				}
				else
				{
					[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
				}
			}
			else
			{
				[System.Windows.Forms.MessageBox]::Show("Všetky povinné údaje musia byť vyplnené")
			}
		}
	}
	
	
