		$script:editLokalita_checkboxScheduler = $checkboxScheduler.Checked
		$script:editLokalita_checkboxRežimPC = $checkboxRežimPC.Checked
		$script:editLokalita_checkboxReštartPC = $checkboxReštartPC.Checked
