	$checkboxPristupy = New-Object 'System.Windows.Forms.CheckBox'
	$labelLokalita = New-Object 'System.Windows.Forms.Label'
	$edit = New-Object 'System.Windows.Forms.Button'
	$checkboxScheduler = New-Object 'System.Windows.Forms.CheckBox'
	$checkboxRežimPC = New-Object 'System.Windows.Forms.CheckBox'
	$checkboxReštartPC = New-Object 'System.Windows.Forms.CheckBox'
	$checkboxVypínaniePC = New-Object 'System.Windows.Forms.CheckBox'
	$checkboxBudeniePC = New-Object 'System.Windows.Forms.CheckBox'
	$textbox2 = New-Object 'System.Windows.Forms.TextBox'
	$textbox1 = New-Object 'System.Windows.Forms.TextBox'
	$name = New-Object 'System.Windows.Forms.Label'
	$InitialFormWindowState = New-Object 'System.Windows.Forms.FormWindowState'
	#endregion Generated Form Objects

	#----------------------------------------------
	# User Generated Script
	#----------------------------------------------
	
	
	#load form
	$formEditUser_Load={
		loadFunctions
	}
	
	
	#loads available user functions
	function loadFunctions()
	{
		
		$data = New-Object System.Data.DataSet
		$data = MysqlQuerySelect -query "SELECT * FROM acl WHERE name='$username' AND id_lokalita='$lokalita'"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $data.Tables[0]
		
		$textbox1.Text = $username
		$textbox2.Text = $lokalita
		
		$dataTable | foreach{
			switch ($_.funkcia)
			{
				"budenie" {
					$checkboxBudeniePC.Checked = $true
					$checkboxBudeniePC.Enabled = $false
				}
				"vypinanie" {
					$checkboxVypínaniePC.Checked = $true
					$checkboxVypínaniePC.Enabled = $false
				}
				"restart" {
					$checkboxReštartPC.Checked = $true
					$checkboxReštartPC.Enabled = $false
				}
				"rezim" {
					$checkboxRežimPC.Checked = $true
					$checkboxRežimPC.Enabled = $false
				}
				"scheduler" {
					$checkboxScheduler.Checked = $true
					$checkboxScheduler.Enabled = $false
				}
				"pristupy" {
					$checkboxPristupy.Checked = $true
					$checkboxPristupy.Enabled = $false
				}
				"oss" {
					$checkboxOSS.Checked = $true
					$checkboxOSS.Enabled = $false
				}
				default
				{
					
				}
			}
		}
	}
	
	
	$edit_Click={
	
		$name = $username
		$id_lokalita=$lokalita
		
		if ($checkboxBudeniePC.Checked -and $checkboxBudeniePC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'budenie')"
			$checkFunkcia = $true
		}
		if ($checkboxVypínaniePC.Checked -and $checkboxVypínaniePC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'vypinanie')"
			$checkFunkcia = $true
		}
		if ($checkboxReštartPC.Checked -and $checkboxReštartPC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'restart')"
			$checkFunkcia = $true
		}
		if ($checkboxRežimPC.Checked -and $checkboxRežimPC.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'rezim')"
			$checkFunkcia = $true
		}
		if ($checkboxScheduler.Checked -and $checkboxScheduler.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'scheduler')"
			$checkFunkcia = $true
		}
		if ($checkboxPristupy.Checked -and $checkboxPristupy.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'law-pristupy')"
			$checkFunkcia = $true
		}
		if ($checkboxOSS.Checked -and $checkboxOSS.Enabled)
		{
			MysqlQueryInsert -query "INSERT INTO acl (id, name, id_lokalita, funkcia) VALUES('','$name', '$id_lokalita', 'dhcp')"
			$checkFunkcia = $true
		}
		if ($checkFunkcia)
		{
			$formEditUser.Close()
		}
		else
		{
			[System.Windows.Forms.MessageBox]::Show("Vyberte aspoň jednú z dostupných funkcionalít")
		}
	}
	
