	#endregion Generated Form Objects

	#----------------------------------------------
	# User Generated Script
	#----------------------------------------------
	
	Import-Module PSDesiredStateConfiguration
	
	$global:adGroup = ""
	$adGroupMember = "Domain users"
	
	$formLAWPrístupy_Load={
		#TODO: Initialize Form Controls here
		#LoadGroupMembership -adGroup $global:adGroup -adGroupMember $adGroupMember
		loadDataToLokalityCombobox
	}
	
	#Load retrieve locality where permission
	function loadDataToLokalityCombobox()
	{
		$source = @()
		$groups = "acl.name='"+$author+"' "
		Get-ADPrincipalGroupMembership -Identity $author -server $domainControler | ForEach-Object{
				$groups += "OR acl.name='"+$_.name+"' "
		}
		
			$data = New-Object System.Data.DataSet
			$data = MysqlQuerySelect -query "SELECT * FROM lokality INNER JOIN acl ON lokality.name=acl.id_lokalita WHERE ($groups) AND acl.funkcia='pristupy' AND lokality.funkcia='pristupy' GROUP BY lokality.name ORDER BY lokality.name ASC"
			$dataTable = new-object System.Data.DataTable
			$dataTable = $data.Tables[0]
			
			
			$dataTable | foreach {
				$tmp = [pscustomobject]@{
					id = $_.id
					name = $_.name
				}
				$source += $tmp
			}
			
			
		
		Load-ComboBox -ComboBox $combobox1 -Items $source -Append -DisplayMember name
	}
	
	
	function checkActionEnd()
	{
		$dataTable = "not empty"
		$loadingImg.Visible = $true
		$i = 0
		$script:LawCancelLoop = $false
		while ($dataTable -ne $null)
		{
			
			[System.Windows.Forms.Application]::DoEvents()
			if (($i % 10) -eq 0)
			{
				$action = New-Object System.Data.DataSet
				$action = mysqlQuerySelect -query "SELECT * FROM fronta WHERE command='pristupy' AND status<>'DONE' "
				$dataTable = new-object System.Data.DataTable
				$dataTable = $action.Tables[0]
				$adGroupStatusOutput.ForeColor = 'Purple'
				$adGroupStatusOutput.Text = "Prebieha zmena stavu prístupov..."
				$buttonAllowAccess.Enabled = $false
				$buttonDenyAccess.Enabled = $false
				$i=-1
			}
			sleep -Milliseconds 100
			$i++
			
		}
		$script:LawCancelLoop = $true
		$loadingImg.Visible = $false
		LoadGroupMembership -adGroup (OUparser -ou $global:adGroup) -adGroupMember $adGroupMember
	}
	
	
	function LoadGroupMembership()
	{
		Param (
			[Parameter(Mandatory = $True, Position = 1)]
			[string]$adGroup,
			[Parameter(Mandatory = $True, Position = 2)]
			[string]$adGroupMember
		)
		
		
		if (Get-ADGroupMember $adGroup | where{ $_.samaccountname -eq $adGroupMember })
		{
			$buttonAllowAccess.Enabled = $false
			$buttonDenyAccess.Enabled = $true
			$adGroupStatusOutput.ForeColor = 'Green'
			$adGroupStatusOutput.Text = "`"UCN\$adGroupMember`" je členom skupiny `"UCN\$adGroup`""
			return $true
		}
		else
		{
			$buttonAllowAccess.Enabled = $true
			$buttonDenyAccess.Enabled = $false
			$adGroupStatusOutput.ForeColor = 'Red'
			$adGroupStatusOutput.Text = "`"UCN\$adGroupMember`" nieje členom skupiny `"UCN\$adGroup`""
			return $false
		}
	}
	
	function GetGroupbyLocalityID()
	{
		Param(
			[string]$id
		)
		
		$action = New-Object System.Data.DataSet
		$action = mysqlQuerySelect -query "SELECT * FROM lokality WHERE id='$id' LIMIT 1"
		$dataTable = new-object System.Data.DataTable
		$dataTable = $action.Tables[0]
		
		return $dataTable[0].dn
	}
	
	
	$buttonAllowAccess_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete povoliť vstup všetkým užívateľom?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$date = Get-Date -Format u
			$operation = $global:adGroup+";"+$adGroupMember
			MysqlQueryInsert -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'pristupy', 'allow;$operation', 'WAITING', '$date', '$author')"
				#[System.Windows.Forms.MessageBox]::Show("Akcia bola pridaná do fronty. Aktuálny stav môžete sledovať v aplikácii Logy")
				checkActionEnd
				#Start-Sleep 10
				#checkActionEnd
				#$formLAWPrístupy.Close()
		}
		
	}
	
	$buttonDenyAccess_Click={
		if ([System.Windows.Forms.MessageBox]::Show("Naozaj chcete zakázať vstup všetkým užívateľom?", "Potvrdenie", [System.Windows.Forms.MessageBoxButtons]::OKCancel) -eq "OK")
		{
			$date = Get-Date -Format u
			$operation = $global:adGroup + ";" + $adGroupMember
			MysqlQueryInsert -query "INSERT INTO fronta (id, command, parameter, status, date, author) VALUES('', 'pristupy', 'deny;$operation', 'WAITING', '$date', '$author')"
			#[System.Windows.Forms.MessageBox]::Show("Akcia bola pridaná do fronty. Aktuálny stav môžete sledovať v aplikácii Logy")
			checkActionEnd
			#Start-Sleep 10
			#checkActionEnd
			#$formLAWPrístupy.Close()
		}
		
	}
	
	
	$formLAWPrístupy_FormClosing=[System.Windows.Forms.FormClosingEventHandler]{
