		{
			[System.Windows.Forms.MessageBox]::Show("Práve prebieha operácia. Po jej ukončení bude okno zavreté...")
		}
	}
	
	
	function OUparser()
	{
		Param(
			[string]$ou
		)
		$outputRaw = $ou.Split(',')
		return $outputRaw[0].Substring(3)
	}
	
	
