		$updateName = $textbox1.Text
		$updateDaytime = "" + $combobox2.SelectedItem.ToString() + ":" + $combobox3.SelectedItem.ToString() + ":00"
		
		$updateDatetime = "" + (Get-Date -Format "yyyy-MM-dd").ToString() + " " + $updateDaytime + ""
		$updateEmailConfirm = $emailConfirm.Text
		
		### NOTE
		$updateNote = $combobox4.SelectedItem.ToString()
		
		### LOCALITY
		$updateLokalitaID = $combobox1.SelectedItem.id.ToString()
		
		##### DISABLED
		
		$updateDisabled = "Nie"
		if ($radiobuttonAno.Checked -eq $true)
		{
			$updateDisabled = "Ano"
		}
		else
		{
			$updateDisabled = "Nie"
		}
		
		if ($radiobuttonRežimPC.Checked -eq $true -and $combobox4.SelectedItem -eq $null)
		{
			[System.Windows.Forms.MessageBox]::Show("Vyberte režim budenia")
		}
		else
		{
			if (($updateLokalitaID -ne -1) -and ($updateName -notlike "") -and ($combobox2.SelectedItem -ne $null) -and ($combobox3.SelectedItem -ne $null))
			{
				#### TYP
				
				$type = ""
				$checkFunckia = $false
				if ($radiobuttonBudeniePC.Checked)
				{
					$type = "budenie"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonVypínaniePC.Checked)
				{
					$type = "vypinanie"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonReštartPC.Checked)
				{
					$type = "restart"
					$checkFunkcia = $true
					$updateNote = ""
				}
				if ($radiobuttonRežimPC.Checked)
				{
					$type = "rezim"
					$checkFunkcia = $true
				}
				
				###### DNI
				if ($checkFunkcia)
				{
					$vyber = $false
					$po = $ut = $str = $stv = $pia = $so = $ne = "Nie"
					if ($checkboxPondelok.Checked)
					{
						$po = "Áno"
						$vyber = $true
					}
					if ($checkboxUtorok.checked)
					{
						$ut = "Áno"
						$vyber = $true
					}
					if ($checkboxStreda.Checked)
					{
						$str = "Áno"
						$vyber = $true
					}
					if ($checkboxŠtvrtok.Checked)
