						$so = "Áno"
						$vyber = $true
					}
					if ($checkboxNedeľa.Checked)
					{
						$ne = "Áno"
						$vyber = $true
					}
					
					$data = New-Object System.Data.DataSet
					$data = MysqlQuerySelect -query "UPDATE scheduler SET name='$updateName', emailConfirm='$updateEmailConfirm', time='$updateDatetime', disabled='$updateDisabled', funkcia='$type', id_lokalita='$updateLokalitaID', note='$updateNote'  WHERE scheduler.id='$lokalitaId' "
					$dataTable = new-object System.Data.DataTable
					$dataTable = $data.Tables[0]
					
					$data = New-Object System.Data.DataSet
					$data = MysqlQuerySelect -query "UPDATE scheduler_time SET time='$updateDaytime', pondelok='$po', utorok='$ut', streda='$str', stvrtok='$stv', piatok='$pia', sobota='$so', nedela='$ne'  WHERE id_scheduler='$lokalitaId' "
					$dataTable = new-object System.Data.DataTable
					$dataTable = $data.Tables[0]
					
					#[System.Windows.Forms.MessageBox]::Show("Úloha bola upravená", "Info", [System.Windows.Forms.MessageBoxButtons]::OK)
					$script:ReturnStatus = $true
					$formEditRepeatTask.close()
				}
				else
